import React from 'react'
import axios from 'axios'

export default function PlayerInfo({ player }){

    const getPlayerImg = async ({ photo }) => {
        const result = await axios.get(`https://localhost:5000/player?id=${player.id}`)
        return result
    }

    return (
        <div>
            <img src='https://platform-static-files.s3.amazonaws.com/premierleague/photos/players/110x140/p121160.jpg'/>
        </div>
    )
}
